    "If the course does not have an end date, learners always see their scores when they submit answers to assessments.": "Si le cours ne comporte aucune date de fin, les \u00e9tudiants pourront toujours voir les notes obtenues apr\u00e8s \u00e9valuation.",
    "If the photos you submit are rejected, try moving the computer or camera orientation to change the lighting angle.  The most common reason for rejection is inability to read the text on the ID card.": "N\u1ebfu \u1ea3nh b\u1ea1n g\u1eedi b\u1ecb t\u1eeb ch\u1ed1i, h\u00e3y th\u1eed di chuy\u1ec3n m\u00e1y t\u00ednh ho\u1eb7c h\u01b0\u1edbng m\u00e1y \u1ea3nh \u0111\u1ec3 thay \u0111\u1ed5i g\u00f3c chi\u1ebfu s\u00e1ng. L\u00fd do t\u1eeb ch\u1ed1i ph\u1ed5 bi\u1ebfn nh\u1ea5t l\u00e0 kh\u00f4ng th\u1ec3 \u0111\u1ecdc \u0111\u01b0\u1ee3c ch\u1eef tr\u00ean th\u1ebb ID.",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "Si la sous-section n'a aucune date d'\u00e9ch\u00e9ance, les \u00e9tudiants pourront toujours voir leurs notes apr\u00e8s avoir donn\u00e9 leurs r\u00e9ponses lors de l'\u00e9valuation. ",
    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "Si cette unit\u00e9 avait \u00e9t\u00e9 pr\u00e9c\u00e9demment publi\u00e9e et rendu disponible aux apprenants, tout changement que vous aviez effectu\u00e9 \u00e0 cette unit\u00e9 lorsqu'elle \u00e9tait cach\u00e9e sont maintenant visibles aux apprenants.",
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "N\u1ebfu \u0111\u01a1n v\u1ecb n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n v\u00e0 ph\u00e1t h\u00e0nh cho h\u1ecdc vi\u00ean, c\u00e1c thay \u0111\u1ed5i m\u00e0 b\u1ea1n \u0111\u00e3 th\u1ef1c hi\u1ec7n tr\u00ean \u0111\u01a1n v\u1ecb khi n\u00f3 \u0111\u01b0\u1ee3c \u1ea9n s\u1ebd \u0111\u01b0\u1ee3c hi\u1ec7n l\u00ean \u0111\u1ed1i v\u1edbi h\u1ecdc vi\u00ean. B\u1ea1n c\u00f3 mu\u1ed1n ti\u1ebfp t\u1ee5c?",
    "If you do not yet have an account, use the button below to register.": "Si vous n'avez pas encore de compte, utilisez le bouton ci-dessous pour vous inscrire.",
    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "Si vous quittez cette page sans la sauvegarder ou soumettre votre r\u00e9ponse, vous perdrez tout le travail r\u00e9alis\u00e9 pour cette r\u00e9ponse.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre \u00e9valuation par les pairs, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre auto-\u00e9valuation, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre \u00e9valuation par l'\u00e9quipe p\u00e9dagogique, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you leave, you can no longer post in this team's discussions.Your place will be available to another learner.": "N\u1ebfu b\u1ea1n r\u1eddi \u0111i, b\u1ea1n kh\u00f4ng th\u1ec3 \u0111\u0103ng b\u00e0i trong c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn c\u1ee7a nh\u00f3m n\u00e0y n\u1eefa. V\u1ecb tr\u00ed c\u1ee7a b\u1ea1n s\u1ebd d\u00e0nh cho ng\u01b0\u1eddi h\u1ecdc kh\u00e1c.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Si vous r\u00e9alisez d'importants changements, pr\u00e9venez les membres de l'\u00e9quipe avant de les faire.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "Si vous rendez ce %(xblockType)s visible aux apprenants, les apprenants pourront voir son contenu apr\u00e8s que la date de publication soit pass\u00e9e et que vous ayez publi\u00e9 cette unit\u00e9. Seules les unit\u00e9s qui sont explicitement cach\u00e9es des apprenants resteront cach\u00e9es apr\u00e8s vous d\u00e9sactivez cette option pour ce %(xblockType)s.",
    "If you proceed, you will be unable to use this account to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "N\u1ebfu ti\u1ebfp t\u1ee5c, b\u1ea1n s\u1ebd kh\u00f4ng th\u1ec3 s\u1eed d\u1ee5ng t\u00e0i kho\u1ea3n n\u00e0y \u0111\u1ec3 tham gia c\u00e1c kh\u00f3a h\u1ecdc tr\u00ean \u1ee9ng d\u1ee5ng {platformName} {siteName}, ho\u1eb7c b\u1ea5t k\u1ef3 trang web n\u00e0o kh\u00e1c do {platformName} l\u01b0u tr\u1eef.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "N\u1ebfu b\u1ea1n x\u00f3a b\u1ea3n ghi n\u00e0y, b\u1ea3n ghi s\u1ebd kh\u00f4ng kh\u1ea3 d\u1ee5ng cho b\u1ea5t k\u1ef3 th\u00e0nh ph\u1ea7n n\u00e0o s\u1eed d\u1ee5ng video n\u00e0y.",
    "If you remove this transcript, the transcript will not be available for this component.": "N\u1ebfu b\u1ea1n x\u00f3a b\u1ea3ng \u0111i\u1ec3m n\u00e0y, b\u1ea3ng \u0111i\u1ec3m s\u1ebd kh\u00f4ng kh\u1ea3 d\u1ee5ng cho th\u00e0nh ph\u1ea7n n\u00e0y.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "N\u1ebfu b\u1ea1n c\u1ea7n h\u1ed7 tr\u1ee3 ch\u1ee5p m\u1ed9t trong hai b\u1ee9c \u1ea3nh \u0111\u1ec3 g\u1eedi, h\u00e3y li\u00ean h\u1ec7 v\u1edbi b\u1ed9 %(platformName)s \u0111\u1ec3 c\u00f3 th\u00eam \u0111\u1ec1 xu\u1ea5t.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "N\u1ebfu b\u1ea1n ch\u1ecdn m\u1ed9t t\u00f9y ch\u1ecdn kh\u00e1c v\u1edbi \"%(hide_label)s\", nh\u1eefng \u0111\u01a1n v\u1ecb \u0111\u00e3 xu\u1ea5t b\u1ea3n trong ph\u1ea7n con n\u00e0y s\u1ebd su\u1ea5t hi\u1ec7n cho ng\u01b0\u1eddi h\u1ecdc tr\u1eeb khi ch\u00fang \u0111\u01b0\u1ee3c \u1ea9n m\u1ed9t c\u00e1ch r\u00f5 r\u00e0ng.",
    "If you still wish to continue and delete your account, please enter your account password:": "N\u1ebfu b\u1ea1n v\u1eabn mu\u1ed1n ti\u1ebfp t\u1ee5c v\u00e0 x\u00f3a t\u00e0i kho\u1ea3n c\u1ee7a m\u00ecnh, vui l\u00f2ng nh\u1eadp m\u1eadt kh\u1ea9u t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n:",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "Si vous utilisez l'\u00e9diteur avanc\u00e9, ce probl\u00e8me sera converti en XML et vous ne serez plus en mesure de revenir \u00e0 l'interface d'\u00e9dition simple.\nPasser \u00e0 l'\u00e9diteur avanc\u00e9 et convertir ce probl\u00e8me en XML?",
