    "Use Current Transcript": "Utiliser la transcription courante",
    "Use Onboarding to introduce learners to proctoring, verify their identity, and create an onboarding profile. Learners must complete the onboarding profile step prior to taking a proctored exam. Profile reviews take 2+ business days.": "S\u1eed d\u1ee5ng Gi\u1edbi thi\u1ec7u \u0111\u1ec3 gi\u1edbi thi\u1ec7u cho ng\u01b0\u1eddi h\u1ecdc ti\u1ebfn tr\u00ecnh, x\u00e1c minh danh t\u00ednh c\u1ee7a h\u1ecd v\u00e0 t\u1ea1o h\u1ed3 s\u01a1 gi\u1edbi thi\u1ec7u. Ng\u01b0\u1eddi h\u1ecdc ph\u1ea3i ho\u00e0n th\u00e0nh b\u01b0\u1edbc h\u1ed3 s\u01a1 gi\u1edbi thi\u1ec7u tr\u01b0\u1edbc khi tham gia m\u1ed9t k\u1ef3 thi \u0111\u01b0\u1ee3c gi\u00e1m s\u00e1t. Qu\u00e1 tr\u00ecnh xem x\u00e9t h\u1ed3 s\u01a1 m\u1ea5t h\u01a1n 2 ng\u00e0y l\u00e0m vi\u1ec7c.",
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "Utilisez un examen de pratique surveill\u00e9 afin d'introduire les apprenants au processus et aux outils de surveillance. Les r\u00e9sultats d'un examen de pratique ne comptent pas pour la note finale de l'\u00e9tudiant.",
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "Utiliser un examen minut\u00e9 pour limiter le temps allou\u00e9 aux participants pour r\u00e9pondre aux exercices de cette sous-section. Les participants doivent soumettre leurs r\u00e9ponses avant la fin du temps allou\u00e9. Vous pouvez allouer du temps suppl\u00e9mentaire \u00e0 des participant depuis l'onglet Enseignant.",
    "Use as a Prerequisite": "Utilis\u00e9 comme Pr\u00e9-requis",
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, click \"Bookmark this page\" under the page title.": "S\u1eed d\u1ee5ng d\u1ea5u trang \u0111\u1ec3 gi\u00fap b\u1ea1n d\u1ec5 d\u00e0ng quay l\u1ea1i c\u00e1c trang ph\u1ea7n m\u1ec1m. \u0110\u1ec3 \u0111\u00e1nh d\u1ea5u trang, h\u00e3y nh\u1ea5p v\u00e0o \"\u0110\u00e1nh d\u1ea5u trang n\u00e0y\" d\u01b0\u1edbi ti\u00eau \u0111\u1ec1 trang.",
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "S\u1eed d\u1ee5ng c\u00e1c nh\u00f3m l\u00e0m c\u01a1 s\u1edf \u0111\u1ec3 chia s\u1ebb c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn. T\u1ea5t c\u1ea3 ng\u01b0\u1eddi h\u1ecdc, kh\u00f4ng ph\u00e2n bi\u1ec7t nh\u00f3m, xem c\u00e1c ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn gi\u1ed1ng nhau, nh\u01b0ng trong c\u00e1c ch\u1ee7 \u0111\u1ec1 chia s\u1ebb, ch\u1ec9 nh\u1eefng th\u00e0nh vi\u00ean c\u1ee7a c\u00f9ng m\u1ed9t nh\u00f3m m\u1edbi th\u1ea5y v\u00e0 tr\u1ea3 l\u1eddi c\u00e1c b\u00e0i \u0111\u0103ng c\u1ee7a nhau.",
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "S\u1eed d\u1ee5ng c\u00e1c ki\u1ec3u \u0111\u0103ng k\u00fd l\u00e0m c\u01a1 s\u1edf \u0111\u1ec3 ph\u00e2n chia c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn. T\u1ea5t c\u1ea3 h\u1ecdc vi\u00ean, b\u1ea5t k\u1ec3 ki\u1ec3u \u0111\u0103ng k\u00fd c\u1ee7a h\u1ecd, xem c\u00e1c ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn gi\u1ed1ng nhau, nh\u01b0ng trong c\u00e1c ch\u1ee7 \u0111\u1ec1 \u0111\u00e3 ph\u00e2n chia, ch\u1ec9 nh\u1eefng h\u1ecdc vi\u00ean trong c\u00f9ng m\u1ed9t ki\u1ec3u \u0111\u0103ng k\u00fd m\u1edbi nh\u00ecn th\u1ea5y v\u00e0 tr\u1ea3 l\u1eddi c\u00e1c b\u00e0i vi\u1ebft c\u1ee7a nhau.",
