    "We couldn't sign you in.": "Nous n'avons pas pu vous connecter.",
    "We have encountered an error. Refresh your browser and then try again.": "\u0110\u00e3 ph\u00e1t hi\u1ec7n l\u1ed7i. L\u00e0m m\u1edbi l\u1ea1i tr\u00ecnh duy\u1ec7t c\u1ee7a b\u1ea1n r\u1ed3i th\u1eed l\u1ea1i.",
    "We have received your information and are verifying your identity. You will see a message on your dashboard when the verification process is complete (usually within 5-7 days). In the meantime, you can still access all available course content.": "Ch\u00fang t\u00f4i \u0111\u00e3 nh\u1eadn \u0111\u01b0\u1ee3c th\u00f4ng tin c\u1ee7a b\u1ea1n v\u00e0 \u0111ang x\u00e1c minh danh t\u00ednh c\u1ee7a b\u1ea1n. B\u1ea1n s\u1ebd th\u1ea5y th\u00f4ng b\u00e1o tr\u00ean trang t\u1ed5ng quan c\u1ee7a m\u00ecnh khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t (th\u01b0\u1eddng trong v\u00f2ng 5-7 ng\u00e0y). Trong th\u1eddi gian ch\u1edd \u0111\u1ee3i, b\u1ea1n v\u1eabn c\u00f3 th\u1ec3 truy c\u1eadp t\u1ea5t c\u1ea3 n\u1ed9i dung kh\u00f3a h\u1ecdc c\u00f3 s\u1eb5n.",
    "We just need a little more information before you start learning with %(platformName)s.": "Nous avons juste besoin d'un peu plus d'informations avant que vous commenciez votre apprentissage avec %(platformName)s.",
    "We securely encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Ch\u00fang t\u00f4i m\u00e3 h\u00f3a \u1ea3nh c\u1ee7a b\u1ea1n m\u1ed9t c\u00e1ch an to\u00e0n v\u00e0 g\u1eedi \u1ea3nh \u0111\u1ebfn d\u1ecbch v\u1ee5 \u1ee7y quy\u1ec1n c\u1ee7a ch\u00fang t\u00f4i \u0111\u1ec3 xem x\u00e9t. \u1ea2nh v\u00e0 th\u00f4ng tin c\u1ee7a b\u1ea1n kh\u00f4ng \u0111\u01b0\u1ee3c l\u01b0u ho\u1eb7c hi\u1ec3n th\u1ecb \u1edf b\u1ea5t k\u1ef3 \u0111\u00e2u tr\u00ean %(platformName)s sau khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t.",
    "We use the highest levels of security available to encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Nous utilisons le niveau de s\u00e9curit\u00e9 le plus \u00e9lev\u00e9 pour chiffrer votre photo et l'envoyer \u00e0 notre service d\u2019autorisation afin d'y \u00eatre examin\u00e9e. Votre photo et vos informations ne sont pas enregistr\u00e9es, et ils ne sont pas visible nulle part sur %(platformName)s apr\u00e8s  l'accomplissement de processus de v\u00e9rification.",
    "We use your verification photos to confirm your identity and ensure the validity of your certificate.": "Ch\u00fang t\u00f4i s\u1eed d\u1ee5ng \u1ea3nh x\u00e1c minh c\u1ee7a b\u1ea1n \u0111\u1ec3 x\u00e1c nh\u1eadn danh t\u00ednh c\u1ee7a b\u1ea1n v\u00e0 \u0111\u1ea3m b\u1ea3o t\u00ednh h\u1ee3p l\u1ec7 c\u1ee7a ch\u1ee9ng ch\u1ec9 c\u1ee7a b\u1ea1n.",
    "We're sorry to see you go! Your account will be deleted shortly.": "Ch\u00fang t\u00f4i r\u1ea5t ti\u1ebfc khi th\u1ea5y b\u1ea1n ra \u0111i! T\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c x\u00f3a ngay.",
    "We're sorry, there was an error": "R\u1ea5t ti\u1ebfc, c\u00f3 l\u1ed7i x\u1ea3y ra",
    "We've encountered an error. Refresh your browser and then try again.": "Nous avons rencontr\u00e9 une erreur. Rafra\u00eechissez votre navigateur puis r\u00e9essayer.",
    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "Un message de confirmation a \u00e9t\u00e9 envoy\u00e9 \u00e0 {new_email_address}. Cliquer le lien dans le message afin de mettre \u00e0 jour votre adresse email.",
    "We've sent a confirmation message to {new_secondary_email_address}. Click the link in the message to update your secondary email address.": "Ch\u00fang t\u00f4i \u0111\u00e3 g\u1eedi m\u1ed9t tin nh\u1eafn x\u00e1c nh\u1eadn t\u1edbi {new_secondary_email_address}. Nh\u1ea5p v\u00e0o li\u00ean k\u1ebft trong tin nh\u1eafn \u0111\u1ec3 c\u1eadp nh\u1eadt \u0111\u1ecba ch\u1ec9 email ph\u1ee5 c\u1ee7a b\u1ea1n.",
    "We've sent a message to {email}. Click the link in the message to reset your password. Didn't receive the message? Contact {anchorStart}technical support{anchorEnd}.": "Nous avons envoy\u00e9 un {email} \u00e0 email. Cliquez sur le lien dans le message pour r\u00e9initialiser votre mot de passe. Vous n'avez pas re\u00e7u de message ?  Contactez le {anchorStart} support technique{anchorEnd}.",
